import React from 'react';
import "./Navbar.css"
function Navbar() {
  return (
    <div>
        <nav ClassName="navbar navbar-light bg-light  ">
            <div ClassName="container-fluid ">
                <h1 className="logo"> Todo</h1>
            </div>
        </nav>
    </div>
  );
}
export default Navbar;
